import HeaderBottom from "./AlllProfile/HeaderBottom/HeaderBottom";
import CenterHeader from "./AlllProfile/CenterHeader/CenterHeader";
import Containers from "./AlllProfile/Containers/Containers";
import CenterCenter from "./AlllProfile/CenterCenter/CenterCenter";
import CenterBottom from "./AlllProfile/CenterBottom/CenterBottom";
import FooterHeader from "./AlllProfile/FooterHeader/FooterHeader";

const Profile = () => {
    return (
        <div>
            <HeaderBottom/>,
            <CenterHeader/>,
            <Containers/>,
            <CenterCenter/>,
            <CenterBottom/>,
            <FooterHeader/>,
        </div>
    )
}
export default Profile
